import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { ScreenReaderProvider } from './contexts/ScreenReaderContext';
// Contexts
import { AuthProvider, useAuth,useAccessibility } from './contexts/AllContexts';
import { AccessibilityProvider } from './contexts/AllContexts';
import { TransactionProvider } from './contexts/AllContexts';

import VoiceInterface from './components/VoiceInterface';
import { useNavigate } from 'react-router-dom';


// Components
import Login from './components/Login';
import Register from './components/Register';
import Dashboard from './components/Dashboard';
import SendMoney from './components/SendMoney';
import Transactions from './components/Transactions';
import Settings from './components/Settings';
import FraudAlerts from './components/FraudAlerts';

// Styles
import './styles/accessibility.css';


function PrivateRoute({ children }) {
  const { isAuthenticated, loading } = useAuth();

  if (loading) {
    return (
      <div className="loading-screen" role="status" aria-live="polite">
        <div className="spinner" aria-label="Loading"></div>
        <p>Loading...</p>
      </div>
    );
  }

  return isAuthenticated ? children : <Navigate to="/login" />;
}

function App() {
  const navigate = useNavigate();
  const { speak, settings } = useAccessibility();
  const { user } = useAuth();

  return (
    <Router>
      <ScreenReaderProvider>
      <AuthProvider>
        <AccessibilityProvider>
          <TransactionProvider>
            <div className="app" role="application">
              {settings.voiceEnabled && (
                <VoiceInterface
                  onAction={(command) => {
                    console.log('ðŸŽ¯ Executing:', command);

                    if (command.action === 'NAVIGATE') {
                      speak('Navigating');
                      navigate(command.target);
                    }

                    if (command.action === 'SHOW_BALANCE') {
                      if (user?.balance != null) {
                        speak(`Your current balance is Rupees ${user.balance}`);
                      }
                    }
                  }}
                />
              )}

              <Routes>
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Register />} />
                <Route 
                  path="/dashboard" 
                  element={
                    <PrivateRoute>
                      <Dashboard />
                    </PrivateRoute>
                  } 
                />
                <Route 
                  path="/send-money" 
                  element={
                    <PrivateRoute>
                      <SendMoney />
                    </PrivateRoute>
                  } 
                />
                <Route 
                  path="/transactions" 
                  element={
                    <PrivateRoute>
                      <Transactions />
                    </PrivateRoute>
                  } 
                />
                <Route 
                  path="/settings" 
                  element={
                    <PrivateRoute>
                      <Settings />
                    </PrivateRoute>
                  } 
                />
                <Route 
                  path="/fraud-alerts" 
                  element={
                    <PrivateRoute>
                      <FraudAlerts />
                    </PrivateRoute>
                  } 
                />
                <Route path="/" element={<Navigate to="/dashboard" />} />
              </Routes>
              <ToastContainer
                position="top-right"
                autoClose={5000}
                hideProgressBar={false}
                newestOnTop
                closeOnClick
                rtl={false}
                pauseOnFocusLoss
                draggable
                pauseOnHover
                role="alert"
                aria-live="assertive"
              />
            </div>
          </TransactionProvider>
        </AccessibilityProvider>
      </AuthProvider>
      </ScreenReaderProvider>
    </Router>
  );
}

export default App;
